--  DDL for Trigger TRIGGER1
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "A1206423"."TRIGGER1" 
BEFORE UPDATE OF RESULT ON OFC 
REFERENCING OLD AS OLD NEW AS NEW
FOR EACH ROW
declare pragma autonomous_transaction; n_resultado char;

BEGIN
  select result into n_resultado from OFC where ID = :new.ID;
  if(n_resultado != n_resultado) then
    raise_application_error(-20000, 'No puedes cambiar el score');
  else
    update OFC set result = :new.result where id = :new.id;
  end if;
END;
/
ALTER TRIGGER "A1206423"."TRIGGER1" ENABLE;
